import React from "react";
import PropTypes from "prop-types";
import AppLayout from "../components/AppLayout";

const profile = () => {
  return (
    <>
      <Head>
        <title></title>
      </Head>
      <AppLayout>
        <NicknameEditForm />
        <FollowList />
        <FollowList />
      </AppLayout>
      ;
    </>
  );
};

profile.propTypes = {};

export default profile;
